import React from 'react';
import './footerComponent.styles.scss';
import { NavLink } from 'react-router-dom';
import friendsImg from './png/friendsImg.png'
import groupsImg from './png/groupsImg.png';
import plusImg from './png/plusImg.png';
import activityImg from './png/activityImg.png';
import accountImg from './png/accountImg.png'

const FooterComponent = () => (
	<footer className="footer">
		<NavLink to="/feed" className="navLink" activeClassName="is-active">
			<img className="imgbar" src={friendsImg} alt="newsbar" />
			<span>Friends</span>
		</NavLink>

		<NavLink to="/barcrawl" className="navLink" activeClassName="is-active">
			<img className="imgbar" src={groupsImg} alt="barcrawlbar" />
			<span>Groups</span>
		</NavLink>

        <NavLink to="/plus" exact className="navLink" activeClassName="is-active">
			<img className="imgbar" src={plusImg} alt="randombar" />
			<span>Activity</span>
		</NavLink>

		<NavLink to="/randomizer" exact className="navLink" activeClassName="is-active">
			<img className="imgbar" src={activityImg} alt="randombar" />
			<span>Activity</span>
		</NavLink>

		<NavLink to="/map" className="navLink" activeClassName="is-active">
			<img className="imgbar" src={accountImg} alt="mapbar" />
			<span>Account</span>
		</NavLink>
	</footer>
);

export default FooterComponent;
